import Navbar from '../components/Navbar'
import Footer from '../components/Footer'

const TemplateDefault = ({ children }) => {
  return (
    <>
    <Navbar />
    <div>
        { children }
    </div>
    <Footer />
    </>
  )
}

export default TemplateDefault
